Compliance_KPIs_1.query:
q = load "${App.Datasets.CG_RetailVisitKpi37_tp.FullyQualifiedName}";
q = filter q by 'Include_In_Compliance' == "True";
q_LastVisit = filter q by 'AssessmentTask_Visit_Id' == "{{coalesce(cell(Last2Visits_1.result, 0, "Id"), "NA").asString()}}";
q_PriorVisit = filter q by 'AssessmentTask_Visit_Id' == "{{coalesce(cell(Last2Visits_1.result, 1, "Id"), "NA").asString()}}";
facings_LastVisit = filter q_LastVisit by 'Type_Computed' == "Facing";
facings_PriorVisit = filter q_PriorVisit by 'Type_Computed' == "Facing";
sos_LastVisit = filter q_LastVisit by 'Type_Computed' == "ShareOfShelf";
sos_PriorVisit = filter q_PriorVisit by 'Type_Computed' == "ShareOfShelf";
oos_LastVisit = filter q_LastVisit by 'Type_Computed' == "OutOfStock";
oos_PriorVisit = filter q_PriorVisit by 'Type_Computed' == "OutOfStock";
promotions_LastVisit = filter q_LastVisit by 'Type_Computed' == "Promotion";
promotions_PriorVisit = filter q_PriorVisit by 'Type_Computed' == "Promotion";
inventory_LastVisit = filter q_LastVisit by 'Type_Computed' == "Inventory";
inventory_PriorVisit = filter q_PriorVisit by 'Type_Computed' == "Inventory";

result = group q_LastVisit by all full, q_PriorVisit by all full, facings_LastVisit by all full, facings_PriorVisit by all full, sos_LastVisit by all full, sos_PriorVisit by all full, oos_LastVisit by all full, oos_PriorVisit by all full, promotions_LastVisit by all full, promotions_PriorVisit by all full, inventory_LastVisit by all full, inventory_PriorVisit by all;

result = foreach result generate avg(q_LastVisit.'Compliance_Percentage') as 'Avg_Compliance_Percentage_LastVisit', avg(q_PriorVisit.'Compliance_Percentage') as 'Avg_Compliance_Percentage_PriorVisit', (avg(q_LastVisit.'Compliance_Percentage') - avg(q_PriorVisit.'Compliance_Percentage')) / avg(q_PriorVisit.'Compliance_Percentage') as 'Compliance_Percentate_Change_vs_PriorVisit',

avg(facings_LastVisit.'Compliance_Percentage') as 'Avg_FacingsCompliance_Percentage_LastVisit', avg(facings_PriorVisit.'Compliance_Percentage') as 'Avg_FacingsCompliance_Percentage_PriorVisit', (avg(facings_LastVisit.'Compliance_Percentage') - avg(facings_PriorVisit.'Compliance_Percentage')) / avg(facings_PriorVisit.'Compliance_Percentage') as 'FacingsCompliance_Percentate_Change_vs_PriorVisit',

avg(sos_LastVisit.'Compliance_Percentage') as 'Avg_SoSCompliance_Percentage_LastVisit', avg(sos_PriorVisit.'Compliance_Percentage') as 'Avg_SoSCompliance_Percentage_PriorVisit', (avg(sos_LastVisit.'Compliance_Percentage') - avg(sos_PriorVisit.'Compliance_Percentage')) / avg(sos_PriorVisit.'Compliance_Percentage') as 'SoSCompliance_Percentate_Change_vs_PriorVisit',

avg(oos_LastVisit.'Compliance_Percentage') as 'Avg_OOSCompliance_Percentage_LastVisit', avg(oos_PriorVisit.'Compliance_Percentage') as 'Avg_OOSCompliance_Percentage_PriorVisit', (avg(oos_LastVisit.'Compliance_Percentage') - avg(oos_PriorVisit.'Compliance_Percentage')) / avg(oos_PriorVisit.'Compliance_Percentage') as 'OOSCompliance_Percentate_Change_vs_PriorVisit',

avg(promotions_LastVisit.'Compliance_Percentage') as 'Avg_PromotionsCompliance_Percentage_LastVisit', avg(promotions_PriorVisit.'Compliance_Percentage') as 'Avg_PromotionsCompliance_Percentage_PriorVisit', (avg(promotions_LastVisit.'Compliance_Percentage') - avg(promotions_PriorVisit.'Compliance_Percentage')) / avg(promotions_PriorVisit.'Compliance_Percentage') as 'PromotionsCompliance_Percentate_Change_vs_PriorVisit',

avg(inventory_LastVisit.'Compliance_Percentage') as 'Avg_InventoryCompliance_Percentage_LastVisit', avg(inventory_PriorVisit.'Compliance_Percentage') as 'Avg_InventoryCompliance_Percentage_PriorVisit', (avg(inventory_LastVisit.'Compliance_Percentage') - avg(inventory_PriorVisit.'Compliance_Percentage')) / avg(inventory_PriorVisit.'Compliance_Percentage') as 'InventoryCompliance_Percentate_Change_vs_PriorVisit';

Last2Visits_1.query:
q = load "${App.Datasets.CG_Visit36_tp.FullyQualifiedName}";
q = filter q by date('ActualVisitStartTime_Year', 'ActualVisitStartTime_Month', 'ActualVisitStartTime_Day') in [.."current day"];
q = filter q by 'Status' == "Completed";
result = group q by ('ActualVisitStartTime_Year', 'ActualVisitStartTime_Month', 'ActualVisitStartTime_Day', 'ActualVisitStartTime_Hour', 'ActualVisitStartTime_Minute', 'ActualVisitStartTime_Second', 'Id', 'RetailStore_Id');
result = foreach result generate q.'ActualVisitStartTime_Year' + "~~~" + q.'ActualVisitStartTime_Month' + "~~~" + q.'ActualVisitStartTime_Day' + "~~~" + q.'ActualVisitStartTime_Hour' + "~~~" + q.'ActualVisitStartTime_Minute' + "~~~" + q.'ActualVisitStartTime_Second' as 'ActualVisitStartTime_Year~~~ActualVisitStartTime_Month~~~ActualVisitStartTime_Day~~~ActualVisitStartTime_Hour~~~ActualVisitStartTime_Minute~~~ActualVisitStartTime_Second', q.'ActualVisitStartTime_Year' as 'ActualVisitStartTime_Year', q.'ActualVisitStartTime_Month' as 'ActualVisitStartTime_Month', q.'ActualVisitStartTime_Day' as 'ActualVisitStartTime_Day', 'ActualVisitStartTime_Hour', 'ActualVisitStartTime_Minute', 'ActualVisitStartTime_Second', sum('ActualVisitStartTime_sec_epoch') as 'ActualVisitStartTime_sec_epoch', q.'Id' as 'Id', q.'RetailStore_Id' as 'RetailStore_Id', avg(q.'ActualVisitDuration') as 'ActualVisitDuration', floor(avg(q.'ActualVisitDuration')/60) as 'ActualVisitDuration_Hrs', ((avg(q.'ActualVisitDuration')/60) - floor(avg(q.'ActualVisitDuration')/60))*60 as 'ActualVisitDuration_Mns';
result = order result by ('ActualVisitStartTime_Year~~~ActualVisitStartTime_Month~~~ActualVisitStartTime_Day~~~ActualVisitStartTime_Hour~~~ActualVisitStartTime_Minute~~~ActualVisitStartTime_Second' desc);
result = limit result 2;
result = group result by ('ActualVisitStartTime_Year', 'ActualVisitStartTime_Month', 'ActualVisitStartTime_Day', 'ActualVisitStartTime_Hour', 'ActualVisitStartTime_Minute', 'ActualVisitStartTime_Second', 'Id', 'RetailStore_Id','ActualVisitStartTime_sec_epoch');
result = foreach result generate 'Id', 'RetailStore_Id', 'ActualVisitStartTime_Year' + "~~~" + 'ActualVisitStartTime_Month' + "~~~" + 'ActualVisitStartTime_Day' + "~~~" + 'ActualVisitStartTime_Hour' + "~~~" + 'ActualVisitStartTime_Minute' + "~~~" + 'ActualVisitStartTime_Second' as 'ActualVisitStartTime_Year~~~ActualVisitStartTime_Month~~~ActualVisitStartTime_Day~~~ActualVisitStartTime_Hour~~~ActualVisitStartTime_Minute~~~ActualVisitStartTime_Second', case when sum('ActualVisitDuration_Hrs')>0 then number_to_string(sum('ActualVisitDuration_Hrs'),"##")+" Hr" else "" end +" "+case when sum('ActualVisitDuration_Mns')>0 then number_to_string(sum('ActualVisitDuration_Mns'),"##")+" Min" else "" end as 'ActualVisitDuration_Hrs_Min_Str', ActualVisitStartTime_Day+" "+toString(toDate(ActualVisitStartTime_sec_epoch), "MMM")+" "+ActualVisitStartTime_Year as 'ActualVisitStartTime_Date_Formatted';
result = order result by ('ActualVisitStartTime_Year~~~ActualVisitStartTime_Month~~~ActualVisitStartTime_Day~~~ActualVisitStartTime_Hour~~~ActualVisitStartTime_Minute~~~ActualVisitStartTime_Second' desc);

Task_KPIs_1.query:
q = load "${App.Datasets.CG_RetailVisitKpi37_tp.FullyQualifiedName}";
q_LastVisit = filter q by 'AssessmentTask_Visit_Id' == "{{coalesce(cell(Last2Visits_1.result, 0, "Id"), "NA").asString()}}";
q_PriorVisit = filter q by 'AssessmentTask_Visit_Id' == "{{coalesce(cell(Last2Visits_1.result, 1, "Id"), "NA").asString()}}";
q_Required_Tasks_LastVisit = filter q_LastVisit by 'AssessmentTask_IsRequired' == "true";
q_Required_Tasks_PriorVisit = filter q_PriorVisit by 'AssessmentTask_IsRequired' == "true";
result = group q_LastVisit by all full, q_PriorVisit by all full, q_Required_Tasks_LastVisit by all full, q_Required_Tasks_PriorVisit by all;
result = foreach result generate count(q_LastVisit) as 'Total_Tasks_LastVisit', (count(q_LastVisit) - count(q_PriorVisit)) / count(q_PriorVisit) as 'Total_Tasks_Percentage_Change_vs_PriorVisit', 
sum(q_LastVisit.'Completed_Tasks_Count') as 'Total_CompletedTasks_LastVisit', (sum(q_LastVisit.'Completed_Tasks_Count') - sum(q_PriorVisit.'Completed_Tasks_Count')) / sum(q_PriorVisit.'Completed_Tasks_Count') as 'Total_CompletedTasks_Percentage_Change_vs_PriorVisit', 
count(q_Required_Tasks_LastVisit) as 'Total_Required_Tasks_LastVisit', (count(q_Required_Tasks_LastVisit) - count(q_Required_Tasks_PriorVisit)) / count(q_Required_Tasks_PriorVisit) as 'Total_Required_Tasks_Percentage_Change_vs_PriorVisit', 
sum(q_Required_Tasks_LastVisit.'Completed_Tasks_Count') as 'Total_Required_CompletedTasks_LastVisit', (sum(q_Required_Tasks_LastVisit.'Completed_Tasks_Count') - sum(q_Required_Tasks_PriorVisit.'Completed_Tasks_Count')) / sum(q_Required_Tasks_PriorVisit.'Completed_Tasks_Count') as 'Total_Required_CompletedTasks_Percentage_Change_vs_PriorVisit',
sum(q_LastVisit.'Completed_Tasks_Count') / count(q_LastVisit) as 'Completed_Tasks_Percentage_LastVisit', sum(q_PriorVisit.'Completed_Tasks_Count') / count(q_PriorVisit) as 'Completed_Tasks_Percentage_PriorVisit';
result = foreach result generate 'Total_Tasks_LastVisit', 'Total_Tasks_Percentage_Change_vs_PriorVisit', 'Total_CompletedTasks_LastVisit', 'Total_CompletedTasks_Percentage_Change_vs_PriorVisit', 'Total_Required_Tasks_LastVisit', 'Total_Required_Tasks_Percentage_Change_vs_PriorVisit', 'Total_Required_CompletedTasks_LastVisit', 'Total_Required_CompletedTasks_Percentage_Change_vs_PriorVisit', 'Completed_Tasks_Percentage_LastVisit', ('Completed_Tasks_Percentage_LastVisit' - 'Completed_Tasks_Percentage_PriorVisit') / 'Completed_Tasks_Percentage_PriorVisit' as 'Completed_Tasks_Percentage_Change_vs_PriorVisit';
result = limit result 1;

Order_KPIs_1.query:
q = load "${App.Datasets.CG_OrderItem36_tp.FullyQualifiedName}";
q_A = filter q by 'Order_AssessmentTaskOrder_AssessmentTask_Visit_Id' == "{{coalesce(cell(Last2Visits_1.result, 0, "Id"), "NA").asString()}}";
q_B = filter q by 'Order_AssessmentTaskOrder_AssessmentTask_Visit_Id' == "{{coalesce(cell(Last2Visits_1.result, 1, "Id"), "NA").asString()}}";
result = group q_A by all full, q_B by all;
result = foreach result generate sum(q_A.'TotalPrice') as 'Revenue_Last_Visit', sum(q_A.'Quantity') as 'Quantity_Last_Visit', unique(q_A.'Product2Id') as 'UniqueProductsSold_Last_Visit', sum(q_B.'TotalPrice') as 'Revenue_Prior_Visit', sum(q_B.'Quantity') as 'Quantity_Prior_Visit', unique(q_B.'Product2Id') as 'UniqueProductsSold_Prior_Visit';
result = foreach result generate 'Revenue_Last_Visit' as 'TotalPrice', 'Quantity_Last_Visit' as 'Quantity', 'UniqueProductsSold_Last_Visit' as 'Total_Num_Products_Sold', 
('Revenue_Last_Visit'- 'Revenue_Prior_Visit')/'Revenue_Prior_Visit' as 'Percent_change_Sales_Embedded', ('Quantity_Last_Visit'- 'Quantity_Prior_Visit')/'Quantity_Prior_Visit' as 'Percent_Change_in_Quantity', ('UniqueProductsSold_Last_Visit'- 'UniqueProductsSold_Prior_Visit')/'UniqueProductsSold_Prior_Visit' as 'Percent_Change_Products_Sold';
result = limit result 2000;

